import { merge } from 'lodash';
import ReactApexChart from 'react-apexcharts';
// material
import { Card, CardHeader, Box } from '@mui/material';
//
import { useTheme, styled } from '@mui/material/styles';
import { BaseOptionChart } from '../components/charts';

// material
//

// ----------------------------------------------------------------------

const CHART_HEIGHT = 392;
const LEGEND_HEIGHT = 72;

const ChartWrapperStyle = styled('div')(({ theme }) => ({
  height: CHART_HEIGHT,
  marginTop: theme.spacing(2),
  '& .apexcharts-canvas svg': {
    height: CHART_HEIGHT
  },
  '& .apexcharts-canvas svg,.apexcharts-canvas foreignObject': {
    overflow: 'visible'
  },
  '& .apexcharts-legend': {
    height: LEGEND_HEIGHT,
    alignContent: 'center',
    position: 'relative !important',
    borderTop: `solid 1px ${theme.palette.divider}`,
    top: `calc(${CHART_HEIGHT - LEGEND_HEIGHT}px) !important`
  }
}));

const CHART_DATA = [
  {
    name: 'Series 1',
    data: [
      80, 50, 30, 40, 100, 20, 80, 50, 30, 40, 100, 20, 80, 50, 30, 40, 100, 20, 80, 50, 30, 40,
      100, 20
    ]
  }
];

export default function CollisionSensor() {
  const theme = useTheme();

  const chartOptions = merge(BaseOptionChart(), {
    stroke: { width: 2 },
    fill: { opacity: 0.48 },
    legend: { floating: true, horizontalAlign: 'center' },
    xaxis: {
      categories: [
        '1',
        '2',
        'Confused',
        'Thinking',
        'Moving',
        '',
        '',
        '',
        '',
        '',
        'Moving',
        'Moving',
        'Standby',
        'Talking',
        'Confused',
        'Thinking',
        'Moving',
        '',
        '',
        '',
        '',
        '',
        'Moving',
        'Moving'
      ],
      labels: {
        style: {
          colors: [
            theme.palette.text.secondary,
            theme.palette.text.secondary,
            theme.palette.text.secondary,
            theme.palette.text.secondary,
            theme.palette.text.secondary,
            theme.palette.text.secondary
          ]
        }
      }
    }
  });

  return (
    <Card>
      <CardHeader title="Distribution of Tasks" />
      <ChartWrapperStyle dir="ltr">
        <ReactApexChart type="radar" series={CHART_DATA} options={chartOptions} height={340} />
      </ChartWrapperStyle>
    </Card>
  );
}
